append itu ditambahkan (di sisi akhir dari string).
kayak gini:

```String a = 'aa';
String b = 'bb';
print(a+b);```

contoh aja gini, nanti kembangkan sendiri:

```  String s = '';
  for (int i = 0; i < 5; i++) {
    s += '${i} ';
  }
  print(s);```
